`,Be(e.p,{children:"This paper presents SWIFT (Swarm-Wise Inference for Fast Trajectory Planning), a distributed one-stage planner designed for efficient multi-quadrotor trajectory optimization in cluttered environments. SWIFT unifies depth-based perception, interaction-aware modeling, and trajectory prediction into a single lightweight network, enabling decentralized real-time planning without reliance on global maps. Each quadrotor processes its local depth observation and asynchronously received neighbor intentions to predict multiple candidate trajectories, leveraging a confidence-guided cross-attention mechanism to selectively model critical inter-agent interactions. The proposed framework achieves sub-millisecond planning latency while ensuring collision avoidance, dynamic feasibility, and cooperative behavior under limited communication. Furthermore, a visual-inertial odometry drift correction strategy based on inter-agent visual detections enhances positioning accuracy during real-world flights. Extensive simulations and forest experiments validate that SWIFT outperforms existing baselines in trajectory smoothness, success rate, scalability, and robustness across diverse scenarios."})]})}function k5e(n={}){const{wrapper:e}=n.components||{};return e?Be(e,{...n,children:Be(A7,{...n})}):A7(n)}const O5e={__name:"Abstract",setup(n){return(e,t)=>{const r=$t("el-divider"),i=$t("el-col"),s=$t("el-row");return G(),me("div",null,[_e(r),_e(s,{justify:"center"},{default:De(()=>[_e(i,{xs:24,sm:20,md:16,lg:12,xl:12,class:"mdx-content"},{default:De(()=>[_e(y(k5e))]),_:1})]),_:1})])}}},N5e=cc(O5e,[["__scopeId","data-v-c9d45e19"]]);function T7(n){const e={h1:"h1",p:"p",strong:"strong",table:"table",tbody:"tbody",td:"td",th:"th",thead:"thead",tr:"tr",...n.components};return Be(Ut,{children:[Be(e.h1,{children:"Experiments"}),`
